def find_max_value_in_k_paths(n, k):

    def gg(n, lol):
        ans = 0
        cur = 1
        lol2 = lol
        while 2 * lol + 1 <= n:
            cur *= 2
            ans += cur
            lol = 2 * lol + 1
            lol2 *= 2
        if lol2 * 2 <= n:
            ans += n - lol2 * 2 + 1
        return ans
    low = 2
    high = n // 2
    res = 1
    while low <= high:
        mid = (low + high) // 2
        if gg(n, mid) >= k:
            res = mid
            low = mid + 1
        else:
            high = mid - 1
    if n == k:
        return 1
    elif gg(n, res) - 1 - gg(n, res * 2) >= k:
        return res * 2 + 1
    else:
        return res * 2

